import React from 'react';
import './App.css';
import { BrowserRouter, Route} from 'react-router-dom';
import RegisterPage from '../src/Components/Register';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <BrowserRouter>
          <Route path="/register" component={RegisterPage}/>
        </BrowserRouter>
      </div>
    )
  }
}

export default App;
